#include "graph_gemm.h"
#include "graph_utils.h"


template <template<int, int, int> class GEMM, 
  int M, int K, int N>
class GemmReluGraphTest : public adf::graph {

  private:
    GemmReluGraph<GEMM, M, K, N> g;

  public:
    adf::input_plio plin[1];
    adf::output_plio plout[1];

    GemmReluGraphTest(
      const std::string& id,
      std::vector<float> weights,
      std::vector<float> bias,
      const std::string& INP_TXT,
      const std::string& OUT_TXT = "gemm_out.txt"
    ): g(weights, bias) { 
      plin[0] = adf::input_plio::create("plin0_gemm"+id+"_input", PLIO64_ARG(INP_TXT));
      plout[0] = adf::output_plio::create("plout0_gemm"+id+"_output", PLIO64_ARG(OUT_TXT));
      adf::connect<adf::window<M*K*4>> (plin[0].out[0], g.pin[0]);
      adf::connect<adf::window<M*N*4>> (g.pout[0], plout[0].in[0]);
    }

};


template <template<int, int, int> class GEMM, 
  int M, int K, int N>
class GemmReluGmemParamGraphTest : public adf::graph {

  private:
    GemmReluGmemParamGraph<GEMM, M, K, N> g;

  public:
    adf::input_plio plin[3];
    adf::output_plio plout[1];

    GemmReluGmemParamGraphTest(
      const std::string& id,
      const std::string& WEIGHT_TXT,
      const std::string& BIAS_TXT,
      const std::string& INP_TXT,
      const std::string& OUT_TXT = "gemm_out.txt"
    ) { 
      plin[0] = adf::input_plio::create("plin0_gemm"+id+"_input", PLIO64_ARG(INP_TXT));
      plin[1] = adf::input_plio::create("plin1_gemm"+id+"_weight", PLIO64_ARG(WEIGHT_TXT));
      plin[2] = adf::input_plio::create("plin2_gemm"+id+"_bias", PLIO64_ARG(BIAS_TXT));
      plout[0] = adf::output_plio::create("plout0_gemm"+id+"_output", PLIO64_ARG(OUT_TXT));
      
      adf::connect<adf::window<M*K*4>> (plin[0].out[0], g.pin[0]);
      adf::connect<adf::window<K*N*4>> (plin[1].out[0], g.pin[1]);
      adf::connect<adf::window<N*4>>   (plin[2].out[0], g.pin[2]);
      adf::connect<adf::window<M*N*4>> (g.pout[0], plout[0].in[0]);
    }

};


